import * as ActionTypes from './ActionTypes';

export const setUser = (user) => ({
    type: ActionTypes.LOGIN,
    payload: user
});

export const login = (phone, otp, name) => dispatch => {
    const user = {
        name: name,
        phone: phone,
        otp: otp
    };
    dispatch(setUser(user));
    alert('Welcome '+name);
}

export const getMessages = (messages) => ({
    type: ActionTypes.FETCH_MESSAGES,
    payload: messages
});

const initialiseLocalStorage = () => {
    const chats = [
        {
            id: 0,
            icon: 'data:image/jpeg;base64,',
            name: 'Steve Smith',
            message: ['Hey there', 'How are you', 'Please reply','Hey there', 'How are you', 'Please reply','Hey there', 'How are you', 'Please reply','Hey there', 'How are you', 'Please reply']
        },
        {
            id:1,
            icon: 'data:image/jpeg;base64,',
            name: 'David Warner',
            message: ['Lets play']
        },
        {
            id: 2,
            icon: 'data:image/jpeg;base64,',
            name: 'Ellyse Perry',
            message: ['Hey dear']
        },
        {
            id: 3,
            icon: 'data:image/jpeg;base64,',
            name: 'Kane Williamson',
            message: ['Please call me']
        },
        {
            id:4,
            icon: 'data:image/jpeg;base64,',
            name: 'Joe Root',
            message: ['Its me from english cricket']
        },
        {
            id: 5,
            icon: 'data:image/jpeg;base64,',
            name: 'Sarah Taylor',
            message: ['Lets meet up some day']
        },
        {
            id: 6,
            icon: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR90sJAN8XEpEkH7a21j7b1Kjq8FFg_6GJOmc_meq3c--tDWbR0&usqp=CAU',
            name: 'Smriti Mandhana',
            message: ['I am free now']
        }
    ];
    const users = {};
    chats.forEach(chat => {
        users[chat.id] = {id: chat.id, name: chat.name, icon: chat.icon};
        localStorage.setItem(chat.id, JSON.stringify(chat.message));
    });
    localStorage.setItem('users', JSON.stringify(users));
}

export const fetchMessages = () => (dispatch) => {
    let users = localStorage.getItem('users');
    if(!users) {
        initialiseLocalStorage();
    }
    users = JSON.parse(localStorage.getItem('users'));
    const messages = Object.values(users).map(user => {return {...user, messages: JSON.parse(localStorage.getItem(user.id))}});
    dispatch(getMessages(messages));
}

export const addMessage = (id, message) => ({
    type: ActionTypes.SEND_MESSAGE,
    payload: {message: message, id: id}
});

export const sendMessage = (id, message) => dispatch => {
    dispatch(addMessage(id, message));
}

export const tryUser = () => ({
    type: ActionTypes.CHECK_USER
});

export const checkUser = () => dispatch => {
    dispatch(tryUser());
}